import React from 'react';

function Stock(props){
    const {name, price_bought_at, price_now} = props.userStock;
    return(
        <React.Fragment>

            <div className="alert alert-primary" role="alert">{name}</div>
            <div className="alert alert-primary" role="alert">{price_bought_at}</div>
            <div className="alert alert-primary" role="alert">{price_now}</div>
            <div>{}</div>
            <div>{}</div>
        </React.Fragment>
    );
}

export default Stock;
